import styled from "styled-components";
import "./App.css";
import { Button } from "react-bootstrap";

const Title = styled.div`
  padding-top: 50px;
  text-align: center;
  font-size: 60px;
  font-family: "Amatic SC", cursive;
`;

const NewTask = styled.div`
  text-align: center;
`;

const AllTasks = styled.div`
  text-align: center;
`;

const Completed = styled.div`
  display: grid;
  justify-comtent: center;
`;

function App() {
  return (
    <div className="App">
      <Title>Feladatok</Title>
      <NewTask>
        <Button variant="outline-dark">Feladat hozzáadása</Button>
      </NewTask>
      <AllTasks></AllTasks>
      <Completed>
        <Button className="Uncompleted" variant="outline-dark">
          Elvégzendő feladatok
        </Button>
        <Button className="Completed" variant="outline-dark">
          Teljesített feladatok
        </Button>
        <Button className="All" variant="outline-dark">
          Összes feladat
        </Button>
      </Completed>
    </div>
  );
}

export default App;
